text:
Es wird von seinem Fleiß die greise Nach-Welt wissen;
                                    Krafft des Er beyde Reich vereinigt / und durch Macht
                                    Mehr durch Verstand zu Ruh und in Gehorsam bracht.

Gesetzt auch daß ich Sie aus meiner Seelen stelte;
                                    Vnd selbst auff mich und sie so grimmig Vrtheil fällte;
                                    Wird nicht der Heere Macht nechst dehnen widerstehn /
                                    Die mir schir jede Stund an beiden Seitten gehn?

                                    Das Carl in stetem Weh' in Stanck und Kercker schmachte /


Daß Ihn was vormals Ihm zu Willen stund verachte;
                                    Ist gantz mein Vorsatz nicht.

Der Stats-Rath welcher hoch durch solche That verbunden;
Beschenckt zum Denckmal dich mit zweymal funfftzig Pfunden


      5


Auch wil man in Jern vor dich bemühet seyn;
So bald ein Ehrenstand dort offen; ist er dein.

Wenn er von Zorn erfrischt verzweifelt in die Schar
                                    Sich ob dem Schauplatz stürtzt / so würd er fechtend sterben;
                                    Hergegen sol die Schmach des Beils den Tod erherben.

Was eines jeden der gekrönt /
                                    Vnd durch dich hinfil / Mord außsöhnt;
                                    Wird wider dich zu Felde zihen.

Das scharffe Beil hat durch den Hals gedrungen;
                                    Vnd man setzt an unser Stat / Aeltesten der Kirchen vor /
                                    Die man gehört mit taubem Ohr.

Nachdem es abermals in Nord sich eingefunden
                                    Wohin man Bischoff sie durch deine Bande riff;
                                    Geschah es daß man dir nach Kopff und Gurgel griff.

Wenn Gott an jenem Tag uns frölich auff wird wecken;
                                    Sol dise Beylag uns ein Kennezeichen seyn
                                    Im Anblick aller Welt wer Gottes und wer mein.

Muß schon ein Vater-Hertz die harten Riß empfinden;


Doch müht der Geist sich hoch diß Leid zu überwinden /
                                    Vnd schlägt den Jammer aus.

doch das man auch das Recht nicht unrecht handel;
                                    Vnd auff gewisser Bahn / nicht ausser Gräntzen wandel;
                                    Trägt dir / Krafft diser Schrifft / der Rath die Vollmacht


                                          47
                                        auff
                                    Vnd gönnt so vil an Ihm dem Vrtheil seinen Lauff.

Auff eil und mache dich an Carls unfruchtbar' Eichen /
                                    Vns hat (es ist nicht ohn) der Blätter Schein verführt;
                                    Nunmehr ists Zeit!

Dem Degen hab ichs nur und meiner Faust zu dancken;
                                    Daß ich mich noch nicht schau auff disem Gläteiß wancken /
                                    Da mancher sich erhöht durch meinen Fall wil sehn.

stünd es nur in meiner Macht;
                                    Sein Haubt von Stock und Beil zu retten noch bedacht;
                                    Vnd doch wird mir / was mir zu wider / hir betriben
                                    Ja diser Mord-schlag selbst von meisten zugeschriben.

Wer nah diß Vnheil siht / wer fern diß Traurspil hört;
                                    Glaubt daß ich selbst mein Ehr auffs gifftigste versehrt /
                                    Vnd legt mir dises zu was ich doch höchst verfluche.

Das Blut das hir wird flissen /
                                    Das Blut mit welchem Carl sein Leichtuch wird begissen;
                                    Ist eur / und euch verwandt!

der du ausser Zeit / vom Thron der Ewikeiten
                                    Vns Menschen unser Zil nicht lässest überschreiten;
                                    Warumb hat sich mein Maß biß auff den Tag erstreckt?

Was uns auff die Baare trägt:
                                    Wie das Wetter sich entzünde;
                                    Wie man Eyd und Pflicht entbinde.

ging zu des Landes blühen;
                                    Warumb denn daß man mich in derer Klauen läst /
                                    Die nur mein Blut begehrt?

Herr dem ein reines Hertz / und das sich dir ergeben /
Vnd das dich einig ehrt und einig libt / gefält;
Der du durch Seelen sihst / dem auch was todt muß leben!

Er hat durch ernste Schreiben
                                    Sich euserstes bemüht den Streich zu hintertreiben;
                                    Doch hat man weder Ihn noch Catten groß geacht;
                                    Die wie es schin / zum Schein nur / zur Verhöre bracht.

So hitzt das Land sich an;
                                    Wenn ein getrotzter Feind / dem nichts entkommen kan /
                                    Mit Schwerdt und Flamme pocht.

Er brandt in heilgem Sehnen;
                                    In dem / wer umb Ihn stund / benetzt mit bittern Thränen
                                    Ob seiner Andacht starrt.

Du / der du über uns mit hellen Augen wachst;
                                    Vnd durch die schwartze Lufft mit glantzen Schlägen krachst;
                                    Du / der du unter uns die grimsten Vrtheil hegest;
                                    Vnd die Verächter stets mit schärffster Qual belegest:


Seidt Zeugen / daß ich nicht der rauen Straffen acht.

Was nun das Volck angeht:
                                    Zeugt der / der für sein Volck und Volckes Freyheit steht;
                                    Der dessen Freyheit mehr als eignen Nutz betrachtet:
                                    Wenn man des Volckes Heil und Leben recht beachtet /
                                    Vnd wie es recht beherscht / und treu versichert hält;
                                    So hat es seinen Wundsch.

Wer nach dem Zepter stelt;
                                    Reist alle Schrancken durch / und sucht ein schrecklich Ende /
                                    Weil Printz und Vnterthan doch unvermischte Stände.

wir wolten Zeit begehren /
                                    Vmb uns zu gutter Nacht was besser zu erklären;
                                    Man gibt uns die nicht nach.
